import React from "react";
import './Navbar.css';

function Navbar(){
    return(
        <div className="navbar">
            <img className="navbar-logo" src='./images/baykomlogo.PNG' />
            <div className="nav-items">
                <a className="navbar-item" href="#"> Anasayfa </a>
                <a className="navbar-item" href="#"> Bayboss </a>
                <a className="navbar-item" href="#"> Referanslar </a>
                <a className="navbar-item" href="#"> İletişim </a>
            </div>
        </div>
    )
}

export default Navbar;
